var $bm_rt;
var goal = thisLayer.effect('Goal')(1);
var result = value;
if (goal == 1) {
    var layer = thisLayer;
    while (layer.hasParent) {
        layer = layer.parent;
        result = $bm_sub(result, layer.rotation);
    }
}
$bm_rt = result;

